import React, { Component } from "react";
import { Button,Accordion,Card } from "react-bootstrap";
import BusinessApplicationList from "./BusinessApplicationList2";
import CollapsibleBusiness from "./CollapsibleBusiness";

class AdminBusinessApproval extends Component {
  constructor() {
    super();
    this.state = {};
  }
  handleClose(){
    this.setState({ show: false });
  };

  render() {
    return (
      <div>
        {/* Heading */}
        <h1>Business Approvals</h1>

        <BusinessApplicationList />
        <CollapsibleBusiness />
    <Accordion defaultActiveKey="0">
    <Card>
    <Card.Header>
    <Accordion.Toggle as={Button} variant="link" eventKey="0">
        Click me!
    </Accordion.Toggle>
    <Button className="float-right" variant="primary" onClick={this.handleClose}>
        Approve
        </Button>
        <Button className="float-right" variant="danger" onClick={this.handleClose}>
        Deny
        </Button>
    </Card.Header>
    <Accordion.Collapse eventKey="0">
        <Card.Body>Hello! I'm the body</Card.Body>
    </Accordion.Collapse>
    </Card>
    <Card>
    <Card.Header>
    <Accordion.Toggle as={Button} variant="link" eventKey="1">
        Click me!
    </Accordion.Toggle>
    </Card.Header>
    <Accordion.Collapse eventKey="1">
        <Card.Body>Hello! I'm another body</Card.Body>
    </Accordion.Collapse>
    </Card>
    </Accordion>
      </div>
    );
  }
}

export default AdminBusinessApproval;
